import './App.css';

import statistika from './stat/statistika';

function App() {
  return (
    <div className="App">
      <div className='header'>
        Количество матчей
      </div>
      <div className='header'>
        Количество четных сетов
      </div>
      <div className='header'>
        Количество балансов
      </div>
      <div className='header'>
        Количество нечетных сетов
      </div>
    </div>
  );
}

export default App;
